export class Node {
    constructor(subject, amount) {
        this.subject = subject;
        this.amount = amount;
        this.next = null;
    }
}

export class LinkedList {
    constructor(subject, amount) {
        this.head = new Node(subject, amount)
        this.length = 1;
        this.tail = this.head;
    }

    // add an element to the end of the linked list
    add(subject, amount) {
        const node = new Node(subject, amount);

        if (!this.head) {
          this.head = node;
          this.tail = this.head;
        } else {
            this.tail.next = node;
            this.tail = node;
        }
        this.length += 1;

        return node
    }

    delete(node) {
        return null
    }

    insert(node) {
        return false
    }

    last() {
        return this.tail
    }

    first() {
        return this.head
    }

    next(node) {
        if(node.next === null) return this.head
        return node.next 
    }
}
